import React from 'react'



const Compras=({compras})=>{
    return(
     <ul className='carro'>
        {compras.map((el)=><li key={el.name}>
          <img className='imgP' alt={el.name} src={el.img}></img>
          
        </li>)}
     </ul>
    )
}

export default Compras;
